import React from "react";
import { Link } from "react-router-dom";

const MovieMenu = () => {
  return (
    <div className="bg-gray-400 text-lg text-black font-bold p-1 rounded hover:bg-yellow-500 h-8 flex items-center">
      <label>Movies</label>
      <select>
        <option className="bg-gray-400 text-lg text-black font-bold p-1 rounded hover:bg-yellow-500 h-8 flex items-center">
          <Link to="/movie">Now Playing</Link>
        </option>
        <option>Top Rated</option>
        <option>Popular</option>
        <option>UpComing</option>
      </select>
    </div>
  );
};

export default MovieMenu;
